import React from 'react';
import '../components_css/administracao.css';

function Administracao() {
    return(
        <div id="adm">
            <div className="top-title">
                <h1>Administração</h1>
            </div>

            <div className="formulario">
                <input placeholder="Informe a cidade"></input>
            </div>

        </div>
    )
}

export default Administracao;
